svg.script:
function $(sel) {
  return document.querySelector(sel);
}

let msls = document.querySelectorAll(".msl");
for(i=0; i<msls.length; i++) {
  msls[i].addEventListener('click', show_name, false);
}

function show_name(el) {
  let el_id;
  if(el.srcElement.id) {
    el_id = el.srcElement.id;
  }
  if (el.srcElement.parentElement.id) {
    el_id = el.srcElement.parentElement.id;
  }
  for(i=0; i<msls.length; i++) {
    msls[i].classList.remove("active");
    msls[i].classList.add("semi");
  }
  $("#"+el_id).classList.remove("semi");
  $("#"+el_id).classList.add("active");

  let txt = el_id.split("-");
  for (i=0; i<txt.length; i++) {
    if(txt[i] === "left" || txt[i] === "right") {
      txt.splice(i, 1);
    }
  }

  $("#txt").textContent = txt.join(" ");

}
